package api.javazs.com.myapi.coderhub.entity;import java.util.Date;/** * 面试题实体 * @author : liuwenlong * @date : 2018/3/9 22:41 */public class QuestionEntity {    Integer id;    String title;    String content;    Date createTime;    Date updateTime;    Integer type;    public Integer getId() {        return id;    }    public void setId(Integer id) {        this.id = id;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getContent() {        return content;    }    public void setContent(String content) {        this.content = content;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public Integer getType() {        return type;    }    public void setType(Integer type) {        this.type = type;    }    @Override    public String toString() {        return "QuestionEntity{" +                "id=" + id +                ", title='" + title + '\'' +                ", content='" + content + '\'' +                ", createTime=" + createTime +                ", updateTime=" + updateTime +                ", type=" + type +                '}';    }}